import React, { Component } from 'react';

const TableHeader = () => { 
    return (
        <thead>
            <tr>
                <th>Name</th>
                <th>Job</th>
            </tr>
        </thead>
    );
}

const TableBody = (props) => { 
    return (
        <tbody >
          {props.users.map(name=>{
            return (<tr>
               <th >{name.name}</th>
               <th>{name.job}</th>
            </tr>)
          })}
        </tbody>
      )
}

class Table extends Component {
    render() {
      return (
        <table>
          <TableHeader />
          <TableBody users={this.props.users.name} />
        </table>
      )
    }
  }

export default Table;
